and &quot;HttpErrorResponse{headers: HttpHeaders, status: 401, statusText: &quot;Unauthorized&quot;&quot;.</p>
</blockquote>
<p>Since i'm following different tutorials to work this out so I know that I've made some mistake with the token code, I just don't know how to fix it. And I would like to thank anyone who's spending time to help! This is my authentication.service.ts</p>
<pre><code>import { Injectable } from '@angular/core';
import {HttpClient} from &quot;@angular/common/http&quot;;
import {Observable, of} from 'rxjs';
import { map } from 'rxjs/operators';
import {Router} from '@angular/router';


export interface UserDetails{
  username: string
  email: string
  password: string
  exp: number
  iat: number
}
interface TokenResponse{
  token: string
}
export interface TokenPayload{
  username: string
  email: string
  password: string
}
@Injectable({
  providedIn: 'root'
})
export class AuthenticationService {
  private token: string

  constructor(private http: HttpClient, private router: Router) {}

  private saveToken(token: string): void{
    localStorage.setItem('usertoken', token)
    this.token = token
  }
  private getToken(): string{
    if(!this.token){
      this.token = localStorage.getItem('usertoken')
    }
    return this.token
  }
  public getUserDetails(): UserDetails{
    const token = this.getToken()
    let payload
    if(token){
      payload = token.split('.')[1]
      payload = window.atob(payload)
      return JSON.parse(payload)
    }else{
      return null
    }
  }
  public isLoggedIn(): boolean{
    const user = this.getUserDetails()
    if(user){
      return user.exp &gt; Date.now()/ 1000
    }
    else{
      return false
    }
  }
  public login(user: TokenPayload): Observable&lt;any&gt;{
    const base = this.http.post('/user/login', user)
    const request = base.pipe(
      map((data: TokenResponse) =&gt; {
        if(data.token){
          this.saveToken(data.token)
        }return data
      })
    )
    return request
  }
  public register(user: TokenPayload) : Observable&lt;any&gt;{
    const base = this.http.post('/user/register', user)
    const request = base.pipe(
      map((data: TokenResponse) =&gt; {
        if(data.token){
          this.saveToken(data.token)
        }
        return data
      })
    )
    return request
  }
  public profile(): Observable&lt;any&gt;{
    return this.http.get('/user/profile',{
      headers: {Authorization: `${this.getToken()}`}
    })
  }
  public logout(): void{
    this.token = ''
    window.localStorage.removeItem('usertoken')
    this.router.navigateByUrl('/')
  }

}
</code></pre>
