        if (!user)
          return res.status(400).json({
            message: &quot;User Does Not Exist&quot;
          });

        const isMatch = await bcrypt.compare(password, user.password);
        if (!isMatch)
          return res.status(400).json({
            message: &quot;Incorrect Password!&quot;
          });

        const payload = {
          user: {
            id: user.id
          }
        };

        jwt.sign(
          payload,
          &quot;randomString&quot;,
          {
            expiresIn: 3600
          },
          (err, token) =&gt; {
            if (err) throw err;
            res.status(200).json({
              token
            });
          }
        );
      } catch (e) {
        console.error(e);
        res.status(500).json({
          message: &quot;Server Error&quot;
        });
      }
    }
  );

