Mongo query with $or on 10,000 $geoWithin query completed faster when split into set of 1000 each made in parallel, why?<p>Basically, My collection has 200,000 documents on which I'm applying $geoWithin among a bunch of selected locations to find documents in these locations.</p>
<p>It looks kind of like:</p>
<pre><code>{
    &quot;$or&quot;: [
        {
            &quot;location&quot;: {
                &quot;$geoWithin&quot;: {
                    &quot;$centerSphere&quot;: [
                        [
                            -12,   // coordinates from document 1
                            23  
                        ],
                        0.00015
                    ]
                }
            }
        },
        {
            &quot;location&quot;: {
                &quot;$geoWithin&quot;: {
                    &quot;$centerSphere&quot;: [
                        [
                            -43, // coordinates from document 2
                            51
                        ],
                        0.00015
                    ]
                }
            }
        }
        .
        .
        .
        .
        .
        .
    ]
}
</code></pre>
<p>It took several minutes to complete when $or was between 8000-10000 locations, However, when we tried splitting the request into multiple similar requests with lesser locations and running parallelly, we got results quickly at a certain value and <strong>increasing it further again increased the time taken</strong>. <strong>Same with decreasing it drastically.</strong></p>
<p>My question is why is this happening and how can we figure out the number that optimized the time taken, are some known factors to be considered?</p>
<p>EDIT: adding query planner</p>
<p>100 locations $geoWithin per call, total - 7.66 secs, Query planner + executionStats -  <a href="https://hastebin.com/ayudozabaz.bash" rel="nofollow noreferrer">https://hastebin.com/ayudozabaz.bash</a></p>
<p>1000 locations $geoWithin per call, total - 6.006 secs, Query planner + executionStats -  <a href="https://hastebin.com/komalicosu.bash" rel="nofollow noreferrer">https://hastebin.com/komalicosu.bash</a></p>
<p>10000 locations $geoWithin per call, total - 16.384 secs, Query planner + executionStats -  <a href="https://hastebin.com/kezamedisa.bash" rel="nofollow noreferrer">https://hastebin.com/kezamedisa.bash</a></p>

