Categories and subcategories product hierarchy with Sails.js<p>I'm trying to build an Amazon like products-categories and subcategories hierarchy with Sails.js.</p>
<p>I started with <a href="https://sailsjs.com/documentation/concepts/models-and-orm/associations/many-to-many" rel="nofollow noreferrer">many-to-many relation</a> and so far I've been able to achieve like half of it. What I got working til now is categories, and categories have products linked to it, below is an instance of it:</p>
<p>Computer Accessories -&gt; Sapphire RX 580, Sapphire 5700XT, Corsair 550W PSU</p>
<p>Here's how the <a href="https://sailsjs.com/documentation/concepts/models-and-orm/associations/many-to-many" rel="nofollow noreferrer">many-to-many relation</a> models look like:</p>
<pre><code>    // Product.js

    module.exports = {

      attributes: {

        name: {
          type: 'string',
          required: true,
          unique: true,
          allowNull: false
        },
        keywords: {
          type: 'json',
          required: false
        },

        // Reference to Category
        category: {
          collection: 'category',
          via: 'product'
        },

      },
    }; 

   // Category.js

    module.exports = {

        attributes: {
            name: {
          type: 'string',
          required: true,
          unique: true
        },
        // Reference to Product
        product: {
          collection: 'product',
          via: 'category'
        }
      }

    };
</code></pre>
<p>What I want to build out of this is to have subcategories to categories, below is an instance of it:</p>
<p>Computer Accessories -&gt; Graphic Cards -&gt; Sapphire RX 580, Sapphire 5700XT</p>
<p>Computer Accessories -&gt; Power Supplies -&gt; Corsair 550W PSU</p>
<p>I'm pretty new to JavaScript and Sails. Any suggestions would be greatly appreciated.</p>

